import React from "react";
import { Route, Link } from "react-router-dom";
import logo from "./logo.svg";
import "./App.css";
import Actors from "./Actors";
import Ideas from "./Ideas";

function App() {
  return (
    <div>
      <nav>
        <Link to="/">Actors</Link>
        <Link to="/currencies">Movie-Ideas</Link>
        <Link to="/currencies">Movie-Notes</Link>
      </nav>
      <Route path="/" exact>
        <Actors />
      </Route>
      <Route path="/currencies"></Route>
      {/* : is telling the react router this is a variable within the React Router and this variable can be whatever we want */}
      <Route path="/price/:currency"></Route>
    </div>
  );
}

export default App;
